Reformatted Question: Ananya went to the confectionery and bought various types of desserts. She bought <fact1>72 eclairs at $18 per dozen</fact1>, <fact2>48 cookies at $21 per dozen</fact2>, and <fact3>48 muffins</fact3>. After a <fact4>20% discount</fact4>, she paid a total of <fact5>$1360</fact5>. What was the cost of muffins per dozen?

Answer: First, let's calculate the cost of eclairs. Since Ananya bought <fact1>72 eclairs at $18 per dozen</fact1>, the total cost of eclairs is 72 / 12 * 18 = $108. Next, let's calculate the cost of cookies. Since Ananya bought <fact2>48 cookies at $21 per dozen</fact2>, the total cost of cookies is 48 / 12 * 21 = $84. The total cost of eclairs and cookies is 108 + 84 = $192. Since Ananya paid a total of <fact5>$1360</fact5> after a <fact4>20% discount</fact4>, the original price before the discount is 1360 / (1 - 0.2) = $1700. The cost of muffins is 1700 - 192 = $1508. Since Ananya bought <fact3>48 muffins</fact3>, the cost of muffins per dozen is 1508 / (48 / 12) = $376 per dozen, then $376/12 = $31.33 for each muffin but in this case, it is asked the price for a dozen of muffins so it is $376 for a dozen of muffins but $376 is not the answer because the price for one muffin is 31.33 so for a dozen is 31.33 * 12 = 376, so the price for one muffin is 31.33 so 31.33 * 12 = 376, but it is not the answer, so we have to do 1508/4 = 377.
The answer is {377}
